l pie de página según lo habitual.',NULL),(721,3,8,104,'Los usuarios buscan usualmente con la tecla intro y esa opción estaba desactivada.',NULL),(722,1,9,104,'',NULL),(723,1,10,104,'',NULL),(724,1,11,104,'',NULL),(725,3,12,104,'',NULL),(726,1,13,104,'',NULL),(727,1,14,104,'',NULL),(728,2,15,104,'',NULL),(729,4,16,104,'',NULL),(730,2,17,104,'',NULL),(731,2,18,104,'',NULL),(732,1,19,104,'',NULL),(733,3,20,104,'',NULL),(734,1,5,110,'',NULL),(735,2,21,110,'no veo nada',NULL),(736,4,22,110,'',NULL),(737,1,1,110,'',NULL),(738,3,2,110,'',NULL),(739,1,3,110,'',NULL),(740,5,8,110,'',NULL),(741,2,9,110,'',NULL),(742,3,10,110,'',NULL),(743,2,11,110,'',NULL),(744,3,12,110,'',NULL),(745,3,13,110,'',NULL),(746,4,14,110,'al menos para poder cambiar el tamaño de letra...',NULL),(747,4,15,110,'',NULL),(748,3,16,110,'',NULL),(749,3,17,110,'',NULL),(750,2,18,110,'',NULL),(751,4,19,110,'',NULL),(752,1,20,110,'',NULL),(753,NULL,NULL,110,NULL,'No he podido hacer la mitad de las cosas porque la letra era demasiado pequeña.<div><br></div><div>Independientemente de la prueba, tengo que añadir que no me parece muy correcto que se hagan pruebas con usuarios a modo de \"obligación\", y más siendo en una clase de máster en la que se paga mucho dinero por recibir las clases.</div>'),(754,1,5,115,'',NULL),(755,1,21,115,'',NULL),(756,1,22,115,'',NULL),(757,1,1,115,'',NULL),(758,1,2,115,'',NULL),(759,1,3,115,'',NULL),(760,1,8,115,'',NULL),(761,2,9,115,'',NULL),(762,3,10,115,'',NULL),(763,1,11,115,'',NULL),(764,5,12,115,'',NULL),(765,1,13,115,'',NULL),(766,1,14,115,'',NULL),(767,1,15,115,'',NULL),(768,5,16,115,'',NULL),(769,1,17,115,'',NULL),(770,5,18,115,'',NULL),(771,1,19,115,'',NULL),(772,3,20,115,'',NULL),(773,NULL,NULL,115,NULL,'Ni se ve, ni se entiende'),(774,1,5,107,'',NULL),(775,1,21,107,'No he sido capaz de encontrar la opción de cancelar las modificaciones a simple vista',NULL),(776,2,22,107,'',NULL),(777,1,1,107,'No he sido capaz de encontrar ninguna opción para el cambio de la fuente',N