erfaz',NULL),(3168,1,26,336,'Al no encontrar rapidamente la opcion para ajustar la interfaz fue bastante frustrante finalizar la tarea. Usualmente en esa instancia el usuario abandona la pagina.',NULL),(3169,2,8,336,'La busqueda resulto efectiva solamente al ingresar el nombre completo de la obra. Usualmente se espera que la busqueda sea con informacion mas vagamente especificada, algo como \'chica tren\' o \'chica en el tren\' deberia de poder retornar el mismo resultado que ingresar el titulo exacto de la busqueda.',NULL),(3170,4,9,336,'Recibi informacion de que el sistema estaba procesando mi pedido y cuando agregue exitosamente el item al carrito recibi una informacion de que la operacion se efectuo exitosamente',NULL),(3171,1,10,336,'Al no ingresar exactamente el titulo de la obra buscada se espera que el sistema pueda sugerir posibles opciones relacionadas a la busqueda, como titulos que contengan las palabras buscadas',NULL),(3172,2,11,336,'Mas informacion de las operaciones y ayuda en cada pantalla permitiria que un usuario primerizo pueda ubicarse mejor, ademas de ubicar opciones de configuracion en la parte superior para facilitar su uso',NULL),(3173,4,12,336,'No necesariamente complejo, mas necesita que las opciones esten mejor ubicadas, usualmente la ayuda y las  configuraciones se buscan en la parte superior',NULL),(3174,2,13,336,'La cuestion del tamanho de fuente por default hizo que se volviera bastante tedioso el usar el sistema. Si es costoso de leer ya inicialmente y no se encuentra rapidamente las opciones para ajustar el sitio se abandona inmediatamente',NULL),(3175,4,14,336,'No necesariamente tecnica, pero al menos el de una persona que ya haya utilizado el mismo servicio y que pueda aclarar las dudas que surgen a medida que se interactua con el sistema',NULL),(3176,3,15,336,'El ajuste de la interfaz y la busqueda hacen que el sistema sea menos atractivo.\r\nPero las informaciones mostradas al realizar una operacion como \'agregar al carrito\' y