INSERT INTO `PREGUNTA_USABILIDAD` VALUES (1,1,'<span style=\"font-weight: normal;\">He logrado poner la interfaz del sistema de acuerdo a </span><span style=\"font-weight: bold;\">mis\r\n    preferencias (tamaño y tipo de letra)</span>','',NULL,1),(2,1,'<span style=\"font-weight: normal;\">He logrado encontrar la </span><span style=\"font-weight: bold;\">información de los plazos para la devolución de artículos</span>','',NULL,1),(3,1,'<span style=\"font-weight: normal;\">Pude encontrar, de una </span><span style=\"font-weight: bold;\">manera sencilla</span><span style=\"font-weight: normal;\">, la información del plazo para la devolución con las </span><span style=\"font-weight: bold;\">configuraciones visuales </span>de la tienda','',NULL,1),(5,2,'<span style=\"font-weight: normal;\">He logrado </span><span style=\"font-weight: bold;\">hacer la cancelación</span>','',NULL,1),(6,2,'<span style=\"font-weight: normal;\">Me fue difícil </span><span style=\"font-weight: bold;\">saber cómo cancelar</span>','',NULL,0),(7,2,'<span style=\"font-weight: normal;\">Me </span><span style=\"font-weight: bold;\">sentí con mucha confianza</span> al hacer la cancelación (SUS 9)','',NULL,0),(8,3,'<span style=\"font-weight: normal;\">He logrado</span><span style=\"font-weight: bold;\"> buscar el artículo</span> deseado','',NULL,1),(9,3,'<span style=\"font-weight: normal;\">He tenido algún tipo de </span><span style=\"font-weight: bold;\">retroalimentación</span> mientras estaba\r\n    realizando la búsqueda. Es decir, en todo momento el sistema<span style=\"font-weight: bold;\"> me\r\n    informaba de lo que estaba haciendo</span>','',NULL,1),(10,3,'<span style=\"font-weight: normal;\">Me he sentido </span><span style=\"font-weight: bold;\">orientado/ayudado por el sistema</span> cuando hice la búsqueda del artículo','',NULL,1),(11,NULL,'Pienso que me gustaría utilizar este Sistema con frecuencia',NULL,NULL,1),(12,NULL,'Encontré el Sistema innecesariamente complejo',NULL,NULL,1),(13,NULL,'Me pareció que el Sistema era fácil de usar',NULL,NULL,1),(14,NULL,'Creo que necesitaría de la ayuda de una persona técnica para poder utilizar este Sistema correctamente','',NULL,1),(15,NULL,'Me pareció que las diversas funciones de este Sistema están bien integradas',NULL,NULL,1),(16,NULL,'Me pareció que había demasiada inconsistencia en este Sistema',NULL,NULL,1),(17,NULL,'Me imagino que la mayoría de personas aprenderían a usar este Sistema muy rápidamente',NULL,NULL,1),(18,NULL,'Me pareció que el Sistema es muy complicado de usar',NULL,NULL,1),(19,NULL,'Me sentí con mucha confianza al usar el Sistema',NULL,NULL,1),(20,NULL,'Tuve que aprender muchas cosas antes de poder comenzar a utilizar este Sistema','',NULL,1),(21,2,'Me sentí cómodo&nbsp;haciendo la <span style=\"font-weight: bold;\">cancelación de las modificaciones</span> que no deseo en mi carrito de compra','',NULL,1),(22,2,'<div>Siento que <span style=\"font-weight: bold;\">el sistema me&nbsp;ayuda</span> porque me provee&nbsp;alerta de los cambios&nbsp;hechos en mi carrito de compra y me solicita confirmación para proceder</div>','',NULL,1),(26,1,'<span style=\"font-weight: normal;\">Las <span style=\"font-weight: bold;\">configuraciones visuales</span> de la tienda me han ayudado a localizar&nbsp;</span><span style=\"font-weight: bold;\">más rápidamente</span>&nbsp;la información del plazo','',NULL,1);
