INSERT INTO `QS_ARTICULO` VALUES (1,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Primer volumen de «El diván de Becca», la trilogía más adictiva, divertida y de alto voltaje de Lena Valenti. Esta es la historia de amor entre Becca, una psicóloga mediática que sigue métodos poco ortodoxos, y Axel, su guapísimo pero inescrutable cámara. Mientras sus destinos se encuentran y separan, un peligro se ciern </span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">e sobre Becca, y Axel será el único capaz de salvarla. Tras varias exitosas intervenciones en Gran Hermano, como psicóloga de apoyo a los concursantes, que la convierten en Trending Topic en twitter, el director de la productora le ofrece a Becca Ferrer la oportunidad de su vida: un programa con el que recorrerá España tratando fobias inverosímiles y extremas con sus sorprendentes métodos. Se trata de El diván de Becca. Al mismo tiempo, su novio decide terminar la relación que ha mantenido con ella durante cinco años. Destrozada, Becca ve en el programa una oportunidad dorada para huir de la tristeza y comenzar de nuevo. Lo que no esperaba era conocer a Axel. Y sobre todo, lo que no esperaba era sentir esa atracción tan poderosa hacia un hombre rudo, borde y perdonavidas. ¿Qué le pasa a Becca? Quizá tanto tratar fobias ajenas ha hecho que olvide que con el amor no se juega... La vida y el amor son sólo para valientes. No temas y déjate llevar</span>',1,'EL DIVAN DE BECCA 1RA VERSION',10,11,9,' COMEDIA ACTUALIZADA EN EL TIEMPO','el-divan-de-becca-primera-versi-n'),(2,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">La épica historia de un náufrago de la Armada Invencible. A finales del siglo XVI España emprende una ambiciosa campaña naval contra Inglaterra. Es un momento crítico, cuando el poderío imperial hispano empieza a declinar, los problemas en Flandes se multiplican y piratas ingleses como Francis Drake atacan Cádiz y las </span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">ciudades españolas en el Caribe, y son recibidos en Londres con todos los honores. Entre espías, monarcas, jefes militares, consejeros y rebeldes irlandeses, en un desfile histórico en el que aparecerán todos los personajes y las intrigas de la alta política del momento, comprenderemos la razón de ser de la Gran Armada, una empresa que acabó siendo la más desastrosa del reinado de Felipe II. Y así llegaremos hasta el capitán Francisco de Cuéllar y su extraordinaria aventura. Cuéllar, trasTras el naufragio de su barco, destrozado por los vientos y el oleaje contra la costa irlandesa en el otoño de 1588, Cuéllar emprendió una marcha dantesca en solitario por el interior de Irlanda. Fue un intento desesperado para escapar de la muerte segura que le esperaba si era capturado, como ocurrió ocurrió con otros muchos náufragos españoles de la expedición, asesinados y desvalijados en cuanto pisaron tierra firme. Fernando Martínez Laínez, uno de los mayores divulgadores de nuestra historia y especialista en la época, se embarca junto a sus protagonistas en una novela épica, con la que aprenderemos los entresijos políticos y militares del momento y viviremos la impresionante historia de supervivencia de un náufrago de la mal llamada «Armada Invencible» en territorio enemigo.</span>',0,'EL NAUFRAGO DE LA GRAN ARMADA',0,16,9,'','el-naufrago-de-la-armada'),(3,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Ã?guila Roja y SÃ¡tur intentan escapar de las trampas que esconde la gruta donde han quedado atrapados mientras buscaban pistas sobre el descendiente directo de Cristo. Llevado por sus convicciones religiosas, SÃ¡tur traiciona a su amo y Gonzalo tomarÃ¡ la difÃ­cil decisiÃ³n de apartar al escudero de su lado. Mientras, el pr</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">imo del zar de Rusia viaja hasta la corte de Felipe IV. Siguiendo el consejo de sus astrÃ³logos, su hija debe contraer matrimonio con un sÃºbdito espaÃ±ol, y todos los hombres casaderos tendrÃ¡n opciÃ³n a este inusual privilegio. Por otro lado, en el palacio de Santillana, los mÃ©dicos recomiendan a la Marquesa una intervenciÃ³n en el ojo que la dejarÃ­a desfigurada. El Comisario insiste en que se someta a la operaciÃ³n pero Lucrecia optarÃ¡ por una peligrosa soluciÃ³n, para la que sÃ³lo podrÃ¡ contar con la ayuda de Margarita. EnmaraÃ±adas madejas sentimentales siguen envolviendo a los personajes, pues mientras Margarita deberÃ¡ decidir si toma los votos y entra en un convento, Gonzalo lucharÃ¡ por recuperarla y MonseÃ±or AdriÃ¡n intentarÃ¡ conquistarla. En cuanto a la Marquesa, persiste en su intento de conquistar a Gonzalo, pero tambiÃ©n se ve en la obligaciÃ³n de permanecer junto al Comisario, que pasarÃ¡ por los peores momentos de su existencia</span>',1,'AGUILA ROJA: TEMPORADA 7 (DVD)',2,30,9,'aguila','aguila-roja--temporada-7-(dvd)-'),(4,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Tras la debacle apocalíptica que dio origen a la serie, los supervivientes constataron que no están solos en el mundo con la llamada telefónica de los miembros de la Estación Espacial Internacional. Este hecho cambiará el curso de los acontecimientos para siempre. Los tripulantes del Estrella Polar se enfrentarán a situa</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.6499996185303px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">ciones más extremas que nunca, elegir entre abandonar a los astronautas o enfrentarse a un ciclón de proporciones incalculables, monstruos prehistóricos, mosquitos mortales, una catarata en medio del mar, tormentas eléctricas, secuestros, rebeliones a bordo... Eso sin contar la llegada de cuatro náufragos con intenciones sospechosas. Espectáculo, misterio, aventura, acción, amor, inquietud y emoción son los ingredientes principales de la arrolladora segunda temporada de EL BARCO.</span>',1,'EL BARCO: 2ª TEMPORADA (BLU-RAY)',4,12,9,'Estrella Polar se enfrentarán a situaciones más extremas que nunca, elegir entre abandonar a los astronautas o enfrentarse a un ciclón de proporciones incalculables, monstruos prehistóricos, mosquitos mortales','qwe'),(5,'- Sistema Operativo<br>Windows 8 (64-bit)<br><br>- Gráficos<br>AMD Radeon™ HD 8250<br><br>- Memoria<br>4 GB DDR3L 1,066 MHz (on BD 4 GB)<br><br>- Multimedia<br>Parlantes estéreo (1.5 W x 2)<br>SoundAlive™<br>Mic Digital interno<br>Cámara Web HD 720p<br><br>- Puertos<br>1 mini VGA<br>1 Micro HDMI<br>1 USB3.0, 1 USB2.0<br>Sleep-and-Charge<br>Lector de tarjetas multimedia 3 en 1 (SD, SDHC, SDXC)<br>1 combo Headphone out / Mic-in<br>1 mini Ethernet<br>1 DC-in<br><br>- Almacenamiento<br>Disco Duro 128 GB<br><br>- Procesador / Chipset<br>Quad-Core (Hasta 1.4 GHz)<br><br>- Pantalla<br>13.3\" HD LED (1366 x 768), Anti-Reflective<br><br>- Color<br>Mineral Ash Black<br><br>- Red<br>802.11bg/n 1 x 1<br>Bluetooth v4.0<br>Gigabit Ethernet [10 / 100 / 1000]<br><br>- Entrada<br>Teclado tipo Island<br>Clickpad<br><br>- Seguridad<br>Slim Security Slot',1,'NOTEBOOK ATIV BOOK 9 LITE - PANTALLA 13.3\" - NP905S3G-K01AR - HNBSAM084',10,650,8,'','notebook-9-lite'),(6,'Los blogs de literatura dicen:\"El autor maneja a la perfección la tensión y el suspense hasta los últimos instantes\"\"Novela de un realismo increíble\"\"Convergen todos los ingredientes necesarios para que un libro te enganche: crímenes, misterio, acción, amor… me ha encantado\"\"Mezcla personajes reales con ficticios de forma m agistral. La trama está tan bien entretejida que es difícil soltar el libro una vez que se empieza\"',1,'EL ASESINATO DE PITÁGORAS (EBOOK)',5,11,9,'','el-asesinato'),(7,'Confesión de Fe crí­tica es un libro que revela todos aquellos puntos discutibles de la fe y los explica desde la misma fe y el conocimiento teológico que a través de los años el autor ha adquirido; las tentaciones de Jesús, la virginidad de Maria o la niñez de Jesús son algunos de los puntos que se abordan en este honesto li bro',1,'CONFESIÓN DE UNA FE CRÍTICA (EBOOK)',50,15,9,'','confesion-de-fe'),(8,'',0,'EL CAMINO ABIERTO POR JESÚS. LUCAS (EBOOK-EPUB) (EBOOK)',0,13,9,'EL CAMINO ABIERTO POR JESÚS. LUCAS (EBOOK-EPUB) (EBOOK)\r\n','camino-abierto-por-jesus'),(9,'TELEVISOR MULTINORMA',0,'TELEVISOR MIDAS HT-8909UVX',0,115,1,'TELEVISOR PLASMA','estamos-a-punto-de-publicar-un-libro'),(19,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">¿Estabas en el tren de las 8.04? ¿Viste algo sospechoso?Rachel, síRachel toma siempre el tren de las 8.04 h. Cada mañana lo mismo: el mismo paisaje, las mismas casas… y la misma parada en la señal roja. Son solo unos segundos, pero le permiten observar a una pareja desayunando tranquilamente en su terraza. Siente que los co </span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">noce y se inventa unos nombres para ellos: Jess y Jason. Su vida es perfecta, no como la suya. Pero un día ve algo. Sucede muy deprisa, pero es suficiente. ¿Y si Jess y Jason no son tan felices como ella cree? ¿Y si nada es lo que parece?Tú no la conoces. Ella a ti, sí.«Un impresionante debut en el mundo del thriller.» The Guardian«Agárrate fuerte... Nunca sabes los horrores que acechan en la siguiente curva» USA Today«Nada como un posible asesinato para romper la monotonía de tu viaje diario en metro» Cosmopolitan</span>',0,'LA CHICA DEL TREN (EBOOK)',0,18,9,'LA CHICA DEL TREN (EBOOK)','la-chica-del-tren-(ebook)'),(20,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Una trepidante historia real que se lee como una novela. A los diecisiete años, Hyeonseo Lee sabía poco del mundo que había más allá de las fronteras de Corea del Norte. Aunque algo intuía. A diferencia de sus conciudadanos, atrapados, como ella, bajo una dictadura feroz, su hogar, situado junto a la frontera china, le p&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">ermitía tener algún atisbo de lo que había más allá. De modo que cuando, a mediados de los noventa, la hambruna asoló el país Hyeonseo empezó a hacerse preguntas. Vivía rodeada de represión, pobreza y hambre: sin duda su país no podía ser, como le habían dicho siempre, «el mejor del planeta», ¿verdad? Sin haber cumplido aún la mayoría de edad, Hyeonseo decidió cruzar la frontera en dirección a China. Sólo por unos días, pensó. Pero su escapada se hizo pública y regresar suponía poner en riesgo a toda su familia. Aprendió chino rápidamente, en un esfuerzo por adaptarse y sobrevivir, y doce años después regresó al punto de partida con el objetivo de hacer pasar la frontera a su madre y a su hermano, y establecerse con ellos en Corea del Sur, un propósito que se revelaría arduo y extremadamente peligroso. Lo que se cuenta en este libro es la historia no sólo de la huida de Hyeonseo y sus largos años de vida en la clandestinidad, sino también de su paso de la infancia a la edad adulta, de su reeducación, de su habilidad para reconstruir con éxito su vida, no una vez, sino dos, primero en China y luego en Corea del Sur. Fuerte, valiente y elocuente, su voz es también buena prueba del triunfo del espíritu humano frente a la arbitrariedad de uno de los regímenes más brutales del mundo</span>',0,'LA CHICA DE LOS SIETE NOMBRES',0,17,9,'HYEONSEO LEE','la-chica-de-los-siete-nombres'),(22,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">EL LABERINTO ERA SÓLO EL PRINCIPIO. Resolver el laberinto se suponía que era el final. No más pruebas, no más huidas. Thomas creía que salir significaba que todos recobrarían sus vidas, pero ninguno sabía a qué clase de vida estaban volviendo. Árida y carbonizada, gran parte de la tierra es un territorio inservible. El sol&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">abrasa, los gobiernos han caído y una misteriosa enfermedad se ha ido apoderando poco a poco de la gente. Sus causas son desconocidas; su resultado, la locura. En un lugar infestado de miseria y ruina, y por donde la gente ha enloquecido y deambula en busca de víctimas, Thomas conoce a una chica, Brenda, que asegura haber contraído la enfermedad y estar a punto de sucumbir a sus efectos. Entretanto, Teresa ha desaparecido, la organización CRUEL les ha dejado un mensaje, un misterioso chico ha llegado y alguien ha tatuado unas palabras en los cuellos de los clarianos. La de Minho dice «el líder»; la de Thomas, «el que debe ser asesinado».</span><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\"><br></span></div><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\"><ul class=\"list07\" style=\"outline: none; list-style: none; margin: 0px; padding: 0px; font-size: 0.917em; line-height: 15px; word-spacing: 0px;\"><li class=\"first-child\" style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Nº de páginas:</span>&nbsp;496 págs.</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Encuadernación:</span>&nbsp;Tapa blanda</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Editorial:</span>&nbsp;NOCTURNA EDICIONES</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Lengua:</span>&nbsp;CASTELLANO</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">ISBN:</span>&nbsp;9788493920005</li></ul></span></div>',0,'EL CORREDOR DEL LABERINTO 2: LAS PRUEBAS',0,15,9,'JAMES DASHNER , NOCTURNA EDICIONES, 2015','el-corredor-del-laberinto-2--las-pruebas'),(23,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Todos -absolutamente- queremos que nos quieran. Es simple. Queremos sentirnos necesitados. Queremos que nos pidan que regresemos, si nos vamos. Queremos pensar que alguien piensa en nosotros, cuando es tan tarde que queremos irnos a dormir. Es simple. Deseamos un cuerpo y todo lo suyo. Deseamos que nos deseen y todo lo nues&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">tro. Ya estamos cansados de hacer y decir, esto y aquello. Tratar de aparentar o no ser nosotros mismos. Soñamos con destaparnos el alma, dejarnos la piel, abandonarnos en las manos de alguien. Ser salvajes. Amar hasta las trancas. Bajar hasta lo profundo y resurgir: más fuertes, más vivos.</span><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\"><br></span></div><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\"><ul class=\"list07\" style=\"outline: none; list-style: none; margin: 0px; padding: 0px; font-size: 0.917em; line-height: 15px; word-spacing: 0px;\"><li class=\"first-child\" style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Encuadernación:</span>&nbsp;Tapa blanda</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Editorial:</span>&nbsp;FRIDA</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Lengua:</span>&nbsp;CASTELLANO</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">ISBN:</span>&nbsp;9788494398926</li></ul></span></div>',0,'EN UN MUNDO DE GRISES',0,23,9,'SERGIO CARRION , FRIDA, 2015','en-un-mundo-de-grises'),(24,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Los años de Downing Street es un brillante retrato de los hechos y las personas de los primeros años de la que fuera primera ministra británica Margaret Thatcher en el poder. La Dama de Hierro nos cuenta en primera persona, haciendo gala de una precisión demoledora, cómo fueron los primeros momentos de su acceso al cargo -l&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">a mayoría de ellos críticos-, las tres victorias electorales, las guerra de las Malvinas, la huelga de los mineros, la bomba de Brighton, el asunto Westland, sus enfrentamientos con determinados ministros faltos del suficiente ánimo o mal aconsejados, así como sus opiniones sobre las diferentes personas con quienes va tratando, tanto estadistas de talla internacional como miembros de su propio Gabinete, sobre las que vierte juicios de una franqueza absoluta.El recuerdo de aquellos años configura la personalidad, y la trayectoria y los acontecimientos, los personajes y los sucesos que se describen dentro de una trama política de tintes novelescos nos ofrecen la imagen perfecta de la hasta ahora única primera ministra británica, dispuesta a cambiar el Reino Unido y su papel en el gran teatro del mundo.Una obra magistral, llena de fuerza y convicción, en la que Margaret Thatcher expone la base de sus creencias y el modo en el que supo convertirlas en hechos durante su gobierno. Su perfeccionismo, su pasión por el cambio, su tenacidad y su asombrosa determinación son evidencias palpables en cada una de las páginas del presente volumen.www.librosaguilar.com</span>',0,'LOS AÑOS DE DOWNING STREET (EDICION 2012)',0,22,9,'MARGARET THATCHER , AGUILAR, 2012','los-a-os-de-downing-street-(edicion-2012)'),(25,'<p style=\"box-sizing: border-box; margin: 0px; color: rgb(119, 119, 119); line-height: 24px; font-family: \'Open Sans\'; font-size: 14.8577px; background-color: rgb(249, 249, 249);\">Incluye</p><p style=\"box-sizing: border-box; margin: 0px; color: rgb(119, 119, 119); line-height: 24px; font-family: \'Open Sans\'; font-size: 14.8577px; background-color: rgb(249, 249, 249);\">– Auricular receptor</p><p style=\"box-sizing: border-box; margin: 0px; color: rgb(119, 119, 119); line-height: 24px; font-family: \'Open Sans\'; font-size: 14.8577px; background-